import React from 'react'

const TodoList = ({data}) => {

    return (
        <div>
            <ul>
                {data.map(({label, id}) => {
                    return (
                            <li key = {id}>
                                {label}
                            </li>
                        )
                })}

            </ul>
        </div>
    )
};

export default TodoList;
